[xml]$ApplicationPicker = @"
<Window
        xmlns="http://schemas.microsoft.com/winfx/2006/xaml/presentation"
        xmlns:x="http://schemas.microsoft.com/winfx/2006/xaml"
        Title="Application Picker" Name="Title"  Height="480" Width="800" BorderBrush="White" Background="$Script:BackgroundColor" ResizeMode="NoResize" WindowStartupLocation="CenterScreen">
    <Grid>
        <Grid.RowDefinitions>
            <RowDefinition Height="39*"/>
            <RowDefinition Height="412*"/>
        </Grid.RowDefinitions>
        <Button Name="buttonStart" Content="Start" HorizontalAlignment="Left" Height="40" Margin="600,350.821,0,0" VerticalAlignment="Top" Width="180" Foreground="$Script:BackgroundColor" FontSize="18" FontWeight="Bold" IsDefault="True" Grid.Row="1"/>
        <Button Name="buttonBack" Content="Back" HorizontalAlignment="Left" Height="40" Margin="380,350.821,0,0" VerticalAlignment="Top" Width="180" Foreground="$Script:BackgroundColor" FontSize="18" FontWeight="Bold" IsDefault="True" Grid.Row="1"/>
        <Image Name="image" HorizontalAlignment="Left" Margin="20,253,0,20" Width="181" Grid.Row="1" />
        <Label Name="Welcome" Content="Add or Remove Applications for this Deployment" HorizontalAlignment="Center" Margin="20,20,0,0" VerticalAlignment="Top" FontSize="24" Foreground="$Script:ForegroundColor" Width="760" Grid.RowSpan="2" HorizontalContentAlignment="Center"/>
        <ListView Name="Applications" HorizontalAlignment="Right" Height="290" Margin="20,40,20,0" Grid.Row="1" VerticalAlignment="Top" Width="390" SelectionMode="Multiple">
            <ListView.GroupStyle>
                <GroupStyle>
                    <GroupStyle.ContainerStyle>
                        <Style TargetType="{x:Type GroupItem}">
                            <Setter Property="Template">
                                <Setter.Value>
                                    <ControlTemplate>
                                        <Expander IsExpanded="false">
                                            <Expander.Header>
                                                <StackPanel Orientation="Horizontal">
                                                    <TextBlock Text="{Binding Name}" FontWeight="Bold" Foreground="Gray" FontSize="18" VerticalAlignment="Center" />
                                                </StackPanel>
                                            </Expander.Header>
                                            <ItemsPresenter />
                                        </Expander>
                                    </ControlTemplate>
                                </Setter.Value>
                            </Setter>
                        </Style>
                    </GroupStyle.ContainerStyle>
                </GroupStyle>
            </ListView.GroupStyle>
            <ListView.ItemTemplate>
                <DataTemplate>
                    <CheckBox Content="{Binding Name}" IsChecked="{Binding Selected}" />
                </DataTemplate>
            </ListView.ItemTemplate>
        </ListView>
        <TextBlock Name="Instructions" HorizontalAlignment="Left" Margin="20,40,0,0" Grid.Row="1" FontSize="13" TextWrapping="Wrap" VerticalAlignment="Top" Height="193" Width="360" Foreground="$Script:ForegroundColor"/>
    </Grid>
</Window>
"@

$Script:Debug = $True
$APIServer = "https://emutility.alaska.edu"

Function Start-ApplicationProfilePicker {
    # Create Main Application form
    $XMLReader = (New-Object System.Xml.XMLNodeReader $ApplicationProfilePicker)
    $XMLProfileForm = [Windows.Markup.XamlReader]::Load($XMLReader)

    # Load Controls for reference later
    $ComboBox = $XMLProfileForm.FindName('ApplicationProfile')
    $Next = $XMLProfileForm.FindName('buttonNext')
    $MainImage = $XMLProfileForm.FindName('image')
    $Title = $XMLProfileForm.FindName('Title')

    #Add in the Image
    $MainImage.Source = $iconImage
    $Title.Icon = $iconImage

    # Get the Application Profiles from the WebService
    $ApplicationProfiles = Invoke-RestMethod "$APIServer/ApplicationProfile" -Method Get

    # Retrieve the location chosen when entering device information
    #If (!$Debug) { $tsenv = New-Object -ComObject Microsoft.SMS.TSEnvironment }
    #If (!$Debug) { $CampusLocation = $tsenv.Value("CampusLocation") }
    
    # Get the appropriate Application Profiles
    $Profiles = $ApplicationProfiles | Where-Object { $_.ApplicationProfileName -ne 'EngineeringBase' } | Sort-Object -Property ApplicationProfileName
    #$Profiles = $ApplicationProfiles | Where-Object { $_.ApplicationProfileName -like "$CampusLocation*" } | Sort-Object -Property ApplicationProfileName

    # Add The Application Profiles to the Combo Box
    ForEach ($Profile in $Profiles) {
        $AppProfile = "$($Profile.ID)   -   $($Profile.ApplicationProfileName)"
        $ComboBox.AddChild($AppProfile)
    }

    $Next.add_click({
            # Enter Code to save the choices as Task Sequence Variables
            $XMLProfileForm.Close()
            Start-ApplicationPicker -ProfileID $ComboBox.SelectedItem
            })
    $XMLProfileForm.ShowDialog()
}
Function Start-ApplicationPicker {
    Param (
        $ProfileID
    )
    # Retrieve only the profile ID
    [int]$SelectedProfile = $ProfileID.Substring(0,3)

    # Create Main Application form
    $XMLReader = (New-Object System.Xml.XMLNodeReader $ApplicationPicker)
    $XMLApplicationForm = [Windows.Markup.XamlReader]::Load($XMLReader)

    # Load Controls for reference later
    $ListBox = $XMLApplicationForm.FindName('Applications')
    $StartWorkflow = $XMLApplicationForm.FindName('buttonStart')
    $Back = $XMLApplicationForm.FindName('buttonBack')
    $MainImage = $XMLApplicationForm.FindName('image')
    $Instructions = $XMLApplicationForm.FindName('Instructions')
    $Title = $XMLApplicationForm.FindName('Title')

    #Add in the Image
    $MainImage.Source = $iconImage
    $Title.Icon = $iconImage

    # Set the text for the instructions
    $Instructions.Text = "Instructions`n`nApplications included as part of the selected profile have already been selected.`n`nTo add or remove from this list, just click on the application you want to add or remove.`n`nSelect the BACK button to pick a new profile.`n`nWhen done, click the START button."

    # Add the Applications to the List Box
        # Get the applications from the Application Profile
        $ProfileApplications = Invoke-RestMethod "$APIServer/ApplicationLists/$SelectedProfile" -Method Get
        $ProfileVariables = Try { Invoke-RestMethod -Uri "$APIServer/VariableList/$SelectedProfile" } catch {}

        # Get all Applications
        $Current = [System.Collections.ArrayList]::new()

        $AllItems = Invoke-RestMethod "$APIServer/AllCategories" -Method Get
        $AllUniqueItems = $AllItems | Select-Object -Property DisplayName,
                                        @{Name='Categories';Expression={If ( ![string]::IsNullOrWhiteSpace($_.Categories) ) { $($_.Categories).Trim() } else { 'Unknown' } } } 


        ForEach ($Application in $AllUniqueItems){
            If ($Application.Categories -like "*;*") {
            $Categories = $($($Application.Categories) -Split ";").Trim()

            ForEach ($Category in $Categories) {
                $CurrentApp = New-Object PSObject -prop @{
                Name=$Application.DisplayName
                Category = $Category
                Selected = If ($ProfileApplications.ApplicationName -contains $Application.DisplayName ){ $True } else { $False }
                }
                [void]$Current.Add($CurrentApp)
            }
            }
            else {
                $CurrentApp = New-Object PSObject -prop @{
                Name=$Application.DisplayName
                Category = $($Application.Categories).Trim()
                Selected = If ($ProfileApplications.ApplicationName -contains $Application.DisplayName ){ $True } else { $False }
                }
                [void]$Current.Add($CurrentApp)
            }
        }
        $AllData = $Current | Sort-Object -Property Category,Name
        $ListGroups = [System.Windows.Data.ListCollectionView]$AllData
        $ListGroups.GroupDescriptions.Add((New-Object System.Windows.Data.PropertyGroupDescription "Category"))
        $ListBox.ItemsSource = $ListGroups

        $ListBox.Focus()

    $StartWorkflow.add_click({
            # Enter Code to save the choices as Task Sequence Variables
            $ApplicationsSelected = $($ListBox.SelectedItems).Name
            If (!$Script:Debug) { $tsenv = New-Object -ComObject Microsoft.SMS.TSEnvironment }
            $Count = 1
            $AppId = @()
            ForEach ( $App in $($Current | Where-Object { $_.Selected -eq $true }) ) {
                #Add Code to add apps
                $Id = "{0:D2}" -f $Count
                $AppId = "XApplications$Id" 
                If (!$Script:Debug) { $tsenv.Value($AppId) = $($App.Name) } else { Write-Host $($App.Name) }
                $Count = $Count + 1
            }

            # Add Task sequence variables
            If ($ProfileVariables -ne $null ) {
            # Code to set the task sequence variables from the API
            ForEach ($Variable in $ProfileVariables) {
                If ($($Variable.Value) -eq 1 ) { $Value = $True } else { $Value = $False }
                If (!$Script:Debug) { $tsenv.Value("$($Variable.Name)") = $Value } else { Write-Host $($Variable.Name) }
            }
        }
            If (!$Script:Debug) { exit }
            else { $XMLApplicationForm.Close() }
            })

    $Back.add_Click({
        $XMLApplicationForm.Close()
        Start-ApplicationProfilePicker
    })
    
    $XMLApplicationForm.ShowDialog()
}
Start-ApplicationProfilePicker
